/// <summary>
/// Finds the record in the <c>VendInvoiceDocumentTmp</c> table by <c>JournalRecId</c>.
/// </summary>
/// <param name="_jourRecId">
/// The record identifier of the record to find.
/// </param>
/// <param name="_createdTransactionId">
/// The createdTransactionId of the record to look for.
/// </param>
/// <param name="_languageId">
/// Language Id of the record to find.
/// </param>
/// <returns>
/// A <c>VendInvoiceDocumentTmp</c> record if one exists; otherwise, an empty record.
/// </returns>
public static VendInvoiceDocumentTmp findJourRecId(
    RecId _jourRecId,
    CreatedTransactionId _createdTransactionId = 0,
    LanguageId _languageId = '')
{
    VendInvoiceDocumentTmp vendInvoiceDocumentTmp;

    if (_jourRecId)
    {
        if (_createdTransactionId)
        {
            select forupdate firstonly vendInvoiceDocumentTmp
                where vendInvoiceDocumentTmp.JournalRecId == _jourRecId
                && vendInvoiceDocumentTmp.createdTransactionId == _createdTransactionId
                && (!_languageId || vendInvoiceDocumentTmp.LanguageId == _languageId);
        }
        else
        {
            select forupdate firstonly vendInvoiceDocumentTmp
                where vendInvoiceDocumentTmp.JournalRecId == _jourRecId;
        }
    }

    return vendInvoiceDocumentTmp;
}
